example.code:
using System;
public class UInt16ParseClass {
  public static void Main() {
    string str = "  100   ";
    Console.WriteLine("String: \"{0}\" <UInt16> {1}",str,UInt16.Parse(str));
  }
}

remarks.para:
This method is not CLS-compliant. For a CLS-compliant 
   alternative use (,
   ).

example.code:
using System;
public class UInt16ToStringExample {
   public static void Main() {
      UInt16 i = 16;
      Console.WriteLine(i);
      String[] formats = {"c", "d", "e", "f", "g", "n", "p", "x" };
      foreach(String str in formats)
         Console.WriteLine("{0}: {1}", str, i.ToString(str));
   }
}
